B17 Flying Legend

History Documentary hosted by Bill Bingham, published by Discovery Channel in 2007 - English narration


Information
------------------------------

An in-depth study of the last remaining flyable B-17s in existence today. Beautifully edited with current and historic footage of the B-17, the producers have captured the true meaning of why she was called 'The Queen of the Skies.'&quot;.
The DVD has a lot of extras.

